import React from "react";
import "./style.css";

function HomeTitle(){
    return(
    <div className="uk-text-center home-title">
        <h1 className = "title">Represent Me</h1>
        <p>Lorem ipsum...</p>
        <p uk-margin>
            <button class="uk-button uk-button-default uk-button-large">Login</button>
            <button class="uk-button uk-button-primary uk-button-large">Sign Up</button>
        </p>        
    </div>
    )
}

export default HomeTitle;
